(1290, 0, 0, 3, 'Privacy policy', 'privacy-policy', '', '', '', '', '', '', '', '', '', '', '', '', '', '<p>\n	<strong>Privacy:</strong> What you should know regarding our privacy policy.</p>\n<p>\n	&nbsp;</p>\n<p style="text-align: center;">\n	<span style="color:#b22222;">WE WILL NOT SHARE OR DISCLOSE YOUR PERSONAL DATA, EVER.</span></p>\n<p style="text-align: center;">\n	&nbsp;</p>\n<p>\n	<strong>Personal Data:</strong> During the process of visiting our website, The microtonersupplies.com.au does not automatically collect any personally identifiable information about you such as name, address, phone number, or e-mail address without your express permission (As in during the ordering process when these details are obtained for the purposes of filling your order and to allow communication between microtonersupplies.com.au and yourself as the client when communication is required in relation to your order).</p>\n<p>\n	<strong>Data Collection:</strong> However, we may collect and use certain non-personal information (e.g., the identity of your Internet browser, the type of operating system you use, your IP address and the domain name of your Internet service provider) to optimize our goods and services (which may include the display of personalized content and advertising) including our Web pages for your computer.</p>\n<p>\n	&quot;We use third-party advertising companies (Google, Yahoo, MSN) to serve ads of our website. These companies may use information (not including your name, address, email address, or telephone number) about your visits to this and other websites in order to provide advertisements about goods and services of interest to you. If you would like more information about this practice and to know your choices about not having this information used by these companies, click here.&#39;</p>\n<p>\n	<strong>Financial Data:</strong> We do not keep or maintain any of your financial data as all payments are processed through PayPal</p>\n<p>\n	<strong>Cookies:</strong> Cookies are data that a Web site transfers to an individual&rsquo;s hard drive for record-keeping purposes. Cookies can facilitate a user&rsquo;s ongoing access to and use of a site. They allow us to track usage patterns and to compile data that can help us improve our content and target advertising. If you do not want information collected through the use of Cookies, there is a simple procedure in most browsers that allows you to deny or accept the Cookie feature. But you should note that Cookies may be necessary to provide you with features such as merchandise transactions or registered services.</p>\n<p>\n	We use some cookies on our web site only for analytical purpose. This helps us to give you a better experience by improving our web site efficiency.</p>\n<p>\n	<strong>Online links to third parties:</strong> microtonersupplies.com.au is not responsible for the content or practices of Web sites operated by third parties that are linked to our sites. These links are meant for the user&rsquo;s convenience only. Links to third party sites do not constitute sponsorship, endorsement or approval by microtonersuppies.com.au of the content, policies or practices of those third party sites. Once you have left our site via such a link, you should check the applicable privacy policy of the third party site.</p>\n<p>\n	<strong>Privacy Act.:</strong> We are bound by the National Privacy Principles in the Privacy Act 1988 (Cth) in relation to the handling of personal information. Where appropriate we will handle personal information relying on the media exemption, related bodies corporate exemption and the employee exemption in the Privacy Act.</p>\n<p>\n	<strong>Disclaimer:</strong> Brother, Hewlett Packard, Lexmark, Canon, Epson and other manufacturer brand names and product logos are used solely for purposes of demonstrating compatibility. Such use of trademarks or links to the web sites of vendors is not intended to imply, directly or indirectly, that those vendors endorse or have any affiliation with any product described on this site.</p>', '', 0, 0, 0, 0, 0, 0, '', '', '', '2015-05-17 07:53:46', '', 0, 0),
(1291, 0, 0, 10062, 'Terms &amp; Conditions', 'terms-n-conditions', '', '', '', '', '', '', '', '', '', '', '', '', '', '<p>\n	By placing an order with www.microtonersupplies.com.au means that you fully understand and accept these Terms &amp; Conditions.</p>\n<p>\n	Prices: All prices are current at time of publishing. Prices are subject to change without notice. All prices listed on this site are in Australian dollar and GST inclusive. Though all care has been taken mistakes/typos are expected.</p>\n<p>\n	Please note that any product with a price $0.00 indicates unavailability of that product.</p>\n<p>\n	<strong>Methods Of Payment:</strong> We utilise PayPal as method of payment. PayPal is the world&rsquo;s most secured payment processor. PayPal accepts all major credit cards as well as direct deposit. You don&rsquo;t have to be a member to use PayPal,</p>\n<p>\n	<strong>Freight Charges:</strong>&nbsp;Currently, any order less than $50.00 value will be charge a flat rate of &nbsp;$4.50 per order. Except WA, TAS &amp; &nbsp;NT .&nbsp;</p>\n<p>\n	<strong>Shipping:</strong> &quot;Next day delivery&quot; applies to only metropolitan areas and if ordered before 12:00pm. It can take up to 3-5 days for remote areas.</p>\n<p>\n	<strong>Warranty:</strong> We guarantee all our non-original consumables for a period of twelve months from the date of delivery. In addition, we guarantee to replace or repair any damage to your printer caused by non-original printer consumables.</p>\n<p>\n	<strong>Returns:</strong> Please use contact form indicating invoice number and reason for returning goods. We will send you a replacement as soon as we receive your enquiry and issue an R.A number for the returned goods.</p>\n<p>\n	While retuning the please ensure that</p>\n<p>\n	You must include a test print copy and R.A number<br />\n	Unwanted, Wrongly ordered or Faulty returned goods must be sent on a freight paid basis by buyer.<br />\n	The product has been not tampered.</p>\n<p>\n	If the product found faulty after investigation, a credit will be issued.</p>\n<p>\n	All faulty original products will be processed according to the respective OEM return policy.</p>\n<p>\n	<strong>All unwanted goods</strong></p>\n<p>\n	Must be sealed and in their original packaging.<br />\n	Must return within 14 days of delivery.<br />\n	A re-stocking fee of 20% of purchased price will apply.</p>\n<p>\n	<strong>If you have any enquiries please contact us</strong></p>', '', 0, 0, 0, 0, 0, 0, '', '', '', '2016-07-07 03:33:59', '', 0, 0),
